import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { Star } from 'lucide-react';
import './TribunalListing.css';

const API_BASE_URL = 'http://localhost:3001';

const TribunalListing = () => {
    const [tribunais, setTribunais] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [filter, setFilter] = useState('all');

    const fetchTribunais = async () => {
        try {
            const response = await axios.get(`${API_BASE_URL}/tribunais`);
            const tribunaisData = response.data;
            
            // Fetch ratings for each tribunal
            const tribunaisWithRatings = await Promise.all(
                tribunaisData.map(async (tribunal) => {
                    try {
                        const ratingRes = await axios.get(`${API_BASE_URL}/tribunais_avaliacao/${tribunal.id_tribunal}`);
                        return {
                            ...tribunal,
                            rating: parseFloat(ratingRes.data.media_ponderada) || 0,
                            totalReviews: ratingRes.data.total_avaliacoes || 0
                        };
                    } catch (err) {
                        console.error(`Error fetching ratings for tribunal ${tribunal.id_tribunal}:`, err);
                        return {
                            ...tribunal,
                            rating: 0,
                            totalReviews: 0
                        };
                    }
                })
            );
            
            setTribunais(tribunaisWithRatings);
            setLoading(false);
        } catch (err) {
            console.error('Error fetching tribunais:', err);
            setError('Falha ao carregar os tribunais. Tente novamente mais tarde.');
            setLoading(false);
        }
    };

    useEffect(() => {
        fetchTribunais();
    }, []);

    const getImageUrl = (imagem) => {
        if (!imagem) return null;
        if (imagem.startsWith('/uploads/')) {
            return `${API_BASE_URL}${imagem}`;
        }
        return `${API_BASE_URL}/uploads/tribunais/${imagem}`;
    };

    const getRatingColor = (rating) => {
        if (rating >= 4) return 'rating-excellent';
        if (rating >= 3) return 'rating-good';
        if (rating >= 2) return 'rating-regular';
        return 'rating-bad';
    };

    const filteredTribunais = tribunais.filter(tribunal => {
        if (filter === 'all') return true;
        if (filter === 'excellent') return tribunal.rating >= 4;
        if (filter === 'good') return tribunal.rating >= 3 && tribunal.rating < 4;
        if (filter === 'regular') return tribunal.rating >= 2 && tribunal.rating < 3;
        if (filter === 'bad') return tribunal.rating < 2;
        return true;
    });

    if (loading) {
        return <div className="loading">Carregando tribunais...</div>;
    }

    if (error) {
        return <div className="error">{error}</div>;
    }

    return (
        <div className="tribunal-listing">
            <header className="listing-header">
                <h1>Avaliações de Tribunais</h1>
                <div className="filter-container">
                    <select 
                        value={filter} 
                        onChange={(e) => setFilter(e.target.value)}
                        className="filter-select"
                    >
                        <option value="all">Todos</option>
                        <option value="excellent">Ótimo (4-5)</option>
                        <option value="good">Bom (3-4)</option>
                        <option value="regular">Regular (2-3)</option>
                        <option value="bad">Ruim (0-2)</option>
                    </select>
                </div>
            </header>

            <div className="tribunais-list">
                {filteredTribunais.map((tribunal) => (
                    <Link 
                        to={`/tribunais/${tribunal.id_tribunal}/feedback`}
                        key={tribunal.id_tribunal}
                        className="tribunal-card"
                    >
                        <div className="tribunal-image">
                            {tribunal.imagem ? (
                                <img 
                                    src={getImageUrl(tribunal.imagem)} 
                                    alt={tribunal.nome}
                                />
                            ) : (
                                <div className="no-image">
                                    <span>Sem imagem</span>
                                </div>
                            )}
                        </div>
                        <div className="tribunal-info">
                            <h2>{tribunal.nome}</h2>
                            <p className="tribunal-description">
                                {tribunal.descricao?.substring(0, 150)}
                                {tribunal.descricao?.length > 150 ? '...' : ''}
                            </p>
                            <div className="tribunal-location">
                                <span>{tribunal.cidade} - {tribunal.estado}</span>
                            </div>
                        </div>
                        <div className="tribunal-rating">
                            <div className={`rating-value ${getRatingColor(tribunal.rating)}`}>
                                {tribunal.rating.toFixed(1)}
                                <Star size={16} className="star-icon" />
                            </div>
                            <div className="total-reviews">
                                {tribunal.totalReviews} avaliações
                            </div>
                        </div>
                    </Link>
                ))}
                {filteredTribunais.length === 0 && (
                    <div className="no-results">
                        Nenhum tribunal encontrado com os filtros selecionados.
                    </div>
                )}
            </div>
        </div>
    );
};

export default TribunalListing;
